import RowOne from "../containers/dashboard-three/row-one";

const DashboardThree = () => {
  return (
    <Layout>
      <Content>
        <WelcomeArea />
        <Row gutters={10}>
          <RowOne />
        </Row>
      </Content>
    </Layout>
  );
};

export default DashboardThree;
